import React, { Component } from "react";
import "./LoginPage.css";

import { connect } from 'react-redux';

class LoginPage extends React.Component {  
    constructor ( props ) {
        super ( props );
    }
    render() {
        return (
            <div className = "LoginPageForm">             
                <section id="content">
                    <form action="">
                        <h1>ДУА "Гімназія №1 г.Ашмяны"</h1>
                        <div>
                            <input 
                                type="text" 
                                placeholder="Username" 
                                required="" 
                                id="username" />
                        </div>
                        <div>
                            <input 
                                type="password" 
                                placeholder="Password" 
                                required="" 
                                id="password" />
                        </div>
                        <div>
                            <input 
                                type="submit" 
                                value="Log in" />                          
                        </div>
                    </form>                    
                </section>
            </div>         
        )
    }
}
<div>
    
</div>
let storeToProps = ( store ) => {
    return {
        id : store.id
    }
}

export default connect(storeToProps) (LoginPage);
